import React, { Component } from "react";

export default class Lists extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        const { items } = this.props;

        return (
            <div>
                {items.map((item, index) => 
                    (<h1>{item.description} #{index + 1}</h1>)
                )}
            </div>
        );
    }
};
